webpackJsonp([77316687190513],{408:function(i,e){i.exports={data:{markdownRemark:{html:'<h3>Описание:</h3>\n<p>Обратные скручивания являются одним из множества упражнений, направленных на проработку пресса. Выполнять данное упражнение можно как на полу, так и на обычной скамье.</p>\n<h3>Порядок выполнения:</h3>\n<ol>\n  <li>Примите положение лежа на полу, вытянув ноги. Руки направлены вдоль тела, ладонями на полу.</li>\n  <li>Исходное положение: зафиксируйте ноги таким образом, чтобы положение бедер были перпендикулярно полу, а стопы сведены вместе.</li>\n  <li>На вдохе – выполните подъем ног вверх, сохраняя зафиксированный угол сгиба, до тех пор, пока колени не коснуться груди.</li>\n  <li>На выдохе – сделав небольшую паузу, вернитесь в исходное положение.</li>\n  <li>Сделайте необходимое количество скручиваний.</li>\n</ol>\n<h3>Советы:</h3>\n<ul>\n  <li>Выполняйте сгибания плавно и подконтрольно.</li>\n  <li>Не отрывайте руки от пола на протяжении всего упражнения.</li>\n  <li>Для дополнительной нагрузки задерживайтесь в верхней точке упражнения на несколько секунд больше.</li>\n</ul>\n<h3>Видео-инструкция:</h3>\n<iframe width="100%" height="550rem" src="https://www.youtube.com/embed/sBkSK-3qObM" frameborder="0" allow="autoplay; encrypted-media" allowfullscreen></iframe>',frontmatter:{path:"/exercise/obratnie-scrucivania",efficiency:"7",title:"Обратные скручивания",image:"https://iq-body.ru/uploads/ra/755x567/training/original/2c03d0c41187966ece7f475732f0d0b4fb6d3f9e.jpeg",image_2:"https://iq-body.ru/uploads/ra/755x567/training/original/0f4fed6298aab3024c643f9d2b381db6ba68fa89.jpeg",image_3:"",image_4:"",filterby:"abs",date:"April 12, 2017",injury:"1",bodypart:"Пресс",filtertype:"isolated",type:"Изолирующее",filterinventory:"ownweight",inventory:"Собственный вес",filterplace:null}}},pathContext:{}}}});
